import React from 'react';
import NavbarExplore from './NavbarExplore';
import Popular from './Popular';
function Explore() {
	return (
		<div>
			<NavbarExplore />
			<section class="bg-light" style={{ minHeight: 700 }}>
				<Popular />
			</section>
		</div>
	);
}
export default Explore;
